text:
when a celebrity like tanushree dutta speaks out against another high profile actor like nana patekar we usually focus on other celebs to see who either support or not support her. but there are other not so famous people like journalist janice sequeira who were witness to the event in question and actually come out to verify the accusation. this is a beautiful case of women supporting other women. and it comes at cost for them. 
women like janice should also be acknowledged. 
