text:
today, the national black women’s justice institute released a new report authored by andrea j. ritchie (@invisiblenomorebook)  on expanding our frame and deepening our demands for safety and healing for survivors of sexual violence. the brief aims to help expand the messaging of the anti-sexual violence movement by centering black women, girls and femmes and building new structures of partnership and accountability for healing, featuring the work of ms. foundation for women grantees byp 100 education fund, black women's blueprint, girls for gender equity - gge, every black girl, trans sistas of color project, and women with a vision. 🔗 to report in bio.
.
.
