text:
coming out story " age 21 i knew something was different about me at age 30 i came out to my sister as a transgender woman and she accepted me as her sister our mom knew about me and i told her that i am a woman she said i  know and i accept you as my daughter. 2007 i officially came out in indianapolis indiana at the pride festival 2 lesbian women helped me to really come out and ever since 2007 i have been out and stayed out."
@angelicamcalhoun 
#femme #equalityrights #equality #gay #lgbtq #baltimorepride #begayish #lesbian #queer #trans #transgender #bi #shethrives #lgbtcommunity #glccb #metoo #baltimorepridecenter

